export class AppComponent {
  title = 'thesis-fe';
}
<h2>Webalkalmazás</h2>
<nav>
  <a routerLink="/users"></a>
  <a routerLink="/user/:id"></a>
  <a routerLink="/items"></a>
  <a routerLink="/items/:id"></a>
</nav>
